60,'en','default','88ea903a972946720e01929169ced757','The above custom field is not fully supported and has been rendered as a standard input.',NULL,NULL,'LINE',NULL,0,'','d4a2579f4497e3feb0155e2b8a540e96','',NULL),(32167,'en','et_builder','0a396a98ffbd2a2ab2d9caf76374d3d6','Welcome To The Divi Builder',NULL,NULL,'LINE',NULL,0,'','d1cfd11113ada65ae9ed6e92bff4b030','',NULL),(32168,'en','et_builder','3527a894a687f0c4fdfdf00caf8b0b8e','%10$sBuilding beautiful pages is a breeze using the Visual Builder. To get started, add a new %1$s to your page by pressing the %2$s button. Next, add a %3$s of columns inside your section by pressing the %4$s button. Finally, start adding some content %5$s inside your columns by pressing the %6$s button. You can customize the design and content of any element on the page by pressing the %7$s button. If you ever need help, visit our %9$s page for a full list of tutorials.',NULL,NULL,'LINE',NULL,0,'','3d21fbab7048d4f4c6a094142a86656f','',NULL),(32169,'en','default','d2c24d59e0baff4d0155fbdf62590867','Section',NULL,NULL,'LINE',NULL,0,'','70c8e69c709436b27066e038841378b6','',NULL),(32170,'en','default','bf17ac149e2e7a530c677e9bd51d3fd2','Modules',NULL,NULL,'LINE',NULL,0,'','fac1495cec6f8a1ccd563495918803da','',NULL),(32171,'en','et_builder','2e76712a68d6f529cdb582f3de2cdaee','Take the Tour',NULL,NULL,'LINE',NULL,0,'','55813535cf90cf93f32b27c50c894d54','',NULL),(32172,'en','et_builder','a25e3197bb9b2475c3b808009d2ca4f6','Load A New Layout',NULL,NULL,'LINE',NULL,0,'','4650ce6278fd7d53816fd3e0b6d48239','',NULL),(32173,'en','et_builder','92bf318cb5eea0f2df229f0d6275e47a','Loading pre-made layouts is a great way to jump-start your new page. The Divi Builder comes with dozens of layouts to choose from, and you can find lots of great free layouts online too. You can save your favorite layouts to the Divi Library and load them on new pages or share them with the community. Click the highlighted button to open the layouts menu and select a pre-made layout.',NULL,NULL,'LINE',NULL,0,'','d3867055127fb7fdb76fa60c17e6ff15','',NULL),(32174,'en','et_builder','6abf8fa4a54ee62323e8b63bdaa0de53','Choose A Layout Pack',NULL,NULL,'LINE',NULL,0,'','9cafed13b8b928119ac8aedd3c0cd102','',NULL),(32175,'en','et_builder','d3f3487ba63f901f729721b5949883d1','Here you can see a list of pre-made layout packs that ship with the Divi Builder. You can also access layouts that you have saved to your Divi Library. Choose the “Divi Builder Demo” layout pack to see the layouts it includes.',NULL,NULL,'LINE',NULL,0,'','b8cde1574a515257286ffb578d3b2089','',NULL),(32176,'en','et_builder','c7a179ce4fde281b90d43df8f8f4d793','Choose A Layout To Start With',NULL,NULL,'LINE',NULL,0,'','6fb662d5f9e45157b3cb3a4cabace2b1','',NULL),(32177,'en','et_builder','a113d9085c2613f1f2cd511b40d06f72','Now you can see more details about the layout pack as well as a list of the layouts it includes. Click “Use Layout” to apply the layout to your page.',NULL,NULL,'LINE',NULL,0,'','3d544768474c41e2e2f722f894d718bc','',NULL),(32178,'en','et_builder','00f0ddbb578b1a5e2f450d4740eef870','Add A New Section',NULL,NULL,'LINE',NULL,0,'','d12cd214fdc090868264fb7c84c8e1da','',NULL),(32179,'en','et_builder','3180b55650224e32fc1878d0ca8bfde9','Now that your pre-made layout has been loaded, we can start adding new content to the page. The Divi Builder organizes content using %1$s, %2$s and Modules. Sections are the largest organizational element. Click the highlighted button to add a new section to the page.',NULL,NULL,'LINE',NULL,0,'','9044c3d6e9e1ccdcde7bb4288ffeaa80','',NULL),(32180,'en','default','855c3eca6c7aaef477b4f03e4699944d','Sections',NULL,NULL,'LINE',NULL,0,'','6168dc06ff5581515b71c7355624bd47','',NULL),(32181,'en','et_builder','3eaef7c407a5efd28f3584336ca78ff2','Choose A Section Type',NULL,NULL,'LINE',NULL,0,'','f4346ef3a99eedf8f0e62a333533c2ac','',NULL),(32182,'en','et_builder','d95fb6d88b58cdc6e1b0d254fdf625bf','The Divi Builder has three different section types. %1$s sections conform to the standard width of your page layout. %2$s Sections can be used to create advanced sidebar layouts. %3$s sections extend the full width of your page and can be used with fullwidth modules. Click the “Regular” section button to add a new section to your page.',NULL,NULL,'LINE',NULL,0,'','9716be255841e292e67641739c1ceced','',NULL),(32183,'en','default','d2203cb1237cb6460cbad94564e39345','Regular',NULL,NULL,'LINE',NULL,0,'','ba222abc1335c0d2b0285cb36c03204e','',NULL),(32184,'en','default','faf0155bd589a720a0e0e930c6e77821','Specialty',NULL,NULL,'LINE',NULL,0,'','a5e9fa0b2f3bc992b4e888d506ef0d6f','',NULL),(32185,'en','default','4b5a9713994cdd44bc37de1b41878493','Fullwidth',NULL,NULL,'LINE',NULL,0,'','72b48eaa19389fe38e8fc781c327ba38','',NULL),(32186,'en','et_builder','65d37e399b764426eb57c91020133dab','Add A New Row Of Columns',NULL,NULL,'LINE',NULL,0,'','107bf20a7677412a516fa3a552343f6e','',NULL),(32187,'en','et_builder','cc757bdf6ef6a01382c51651bd5b8da0','Every section contains one or more %1$s of columns. You can choose between various column layouts for each row you add to your page. Click the highlighted three-column layout to add a new row to your section.',NULL,NULL,'LINE',NULL,0,'','b92e17151f219be87915b50e35740f71','',NULL),(32188,'en','et_builder','8d38d9496cb8622f6aa1fda269e92bbf','Add A Module To The Column',NULL,NULL,'LINE',NULL,0,'','74a4912ffb05bb143e6b7af6f78f4188','',NULL),(32189,'en','et_builder','958da876f99d31fd12834ff46916108e','Within each column you can add one or more Modules. A module is basic content element. The Divi Builder comes with over 40 different content elements to choose from, such as Images, Videos, Text, and Buttons. Click the highlighted Blurb button to add a new Blurb module to the first column in your row.',NULL,NULL,'LINE',NULL,0,'','97e95d4646c984f856292d4edabf7ab7','',NULL),(32190,'en','et_builder','6e5a0c56851c06d9bd4068ed66a50996','Adjust Your Module Settings',NULL,NULL,'LINE',NULL,0,'','f5f001f57093fb136b10d0148cb314a7','',NULL),(32191,'en','et_builder','a3d4dcd9c95deb1226f167a181344dc3','Each Module comes with various settings. These settings are separated into three tabs: Content, Design and Advanced. Inside the content tab you can modify the module content elements, such as text and images. If you need more control over the appearance of your module, head over to the Design tab. For more advanced modifications, such as custom CSS and HTML attributes, explore the Advanced tab. Try adjusting the Title of your blurb by clicking into the highlighted field.',NULL,NULL,'LINE',NULL,0,'','4b42690ea72094a912ad0dbc5592e912','',NULL),(32192,'en','et_builder','783d6d8437db9be95bc1d1997679dce8','Accept Or Discard Your Changes',NULL,NULL,'LINE',NULL,0,'','670ca6c1138c5190043e6495505fe628','',NULL),(32193,'en','et_builder','a202e5f39bd9634a1dfdf7ccfc6c398e','Whenever you make changes in the Divi Builder, these changes can be Undone, Redone, Discarded or Accepted. Now that you have adjusted your module’s title, you can click the red discard button to cancel these changes, or your can click the green button to accept them.',NULL,NULL,'LINE',NULL,0,'','d9cf226a9aba2aea02bf5cbf26f95a01','',NULL),(32194,'en','et_builder','832bac93fff132c7d568cf582893140f','Hover To Access Action Buttons',NULL,NULL,'LINE',NULL,0,'','556a282c776901d324bb5534231070ee','',NULL),(32195,'en','et_builder','02e7957aa38c453e4ca90ba9c76d1398','Whenever you hover over a Section, Row or Module in the Divi Builder, action buttons will appear. These buttons can be used to move, modify, duplicate or delete your content. Click the highlighted “duplicate” icon to duplicate the blurb module that you just added to the page.',NULL,NULL,'LINE',NULL,0,'','e9be52e039f36eec4c29b3826881a6d1','',NULL),(32196,'en','et_builder','e4d0143fecef1f1e5ccca68139ab1e05','Drag & Drop Content',NULL,NULL,'LINE',NULL,0,'','89aef268bd3728adf23ce723bc27f592','',NULL),(32197,'en','et_builder','92804e1e7c2b5f93bc9b1a51e2a76223','Every item on the page can be dragged and dropped to new locations. Using your mouse, click the highlighted move icon and hold down the mouse button. While holding down the mouse button, move your cursor over to the empty column and then release your mouse button to drop the module into the new column.',NULL,NULL,'LINE',NULL,0,'','1e3a5b040940309ad173a504b30dbde2','',NULL),(32198,'en','et_builder','71e501c4fc2634ff05abcdfa556b866e','Access Right Click Options',NULL,NULL,'LINE',NULL,0,'','71e8888ece4169a7da2f371831355016','',NULL),(32199,'en','et_builder','f8b1aedc77295da5313a25000d51f7fc','In addition to hover actions, additional options can be accessed by Right Clicking or Cmd + Clicking on any module, row or section. Using the right click menu shown, click the highlighted “Copy Module” button to copy the blurb module that you just moved.',NULL,NULL,'LINE',NULL,0,'','3fe8529924fe0e4bf2683a51f1816c5c','',NULL),(32200,'en','et_builder','ad1b7159bba93dec819b06f4740e7e24','Paste Your Copied Module',NULL,NULL,'LINE',NULL,0,'','dbefb538bf7736b8e2bd5ae364f26d5d','',NULL),(32201,'en','et_builder','a629b024925e85082cb330ab0bec31b4','Now that you have copied a module using the Right Click menu, you can Right Click in a new location to paste that module. Using the right click options shown, click the “Paste Module” button to paste the module you just copied into the empty column.',NULL,NULL,'LINE',NULL,0,'','03e463bfbf8ca8bbbab14bd9756f06a9','',NULL),(32202,'en','et_builder','d6c34ba6380258a9b94e5adab4b72890','Access Your Row Options',NULL,NULL,'LINE',NULL,0,'','a29525b8fdd1219d46653ae400041edc','',NULL),(32203,'en','et_builder','b717e276a801c93f2fd0638e90b91112','Every Row and Section has its own set of options that can be used to adjust the item’s appearance. You can adjust its width, padding, background and more. To access a row’s settings, hover over the row and click the highlighted options button.',NULL,NULL,'LINE',NULL,0,'','7f3862bc1a7b504511dfadd921d5c68a','',NULL),(32204