'acf','af66d0e277d28cd47540fe2ef0a6b3f2','Hide on screen',NULL,NULL,'LINE',NULL,0,'','7d770c51903fa5ecd3f54639163a6ea2','',NULL),(33283,'en','acf','588589fe21449d7ffcf3f289056a9fc8','<b>Select</b> items to <b>hide</b> them from the edit screen.',NULL,NULL,'LINE',NULL,0,'','d5ae8c6f49c979bd363c36c79c636c73','',NULL),(33284,'en','acf','bea1b2615ba2b4d4a5b18daad21b6d3d','If multiple field groups appear on an edit screen, the first field group\'s options will be used (the one with the lowest order number)',NULL,NULL,'LINE',NULL,0,'','a6cee424546fb5760220d888fa3d1009','',NULL),(33285,'en','acf','d9195745d8ed9c995cd88c39c08fab90','Toggle All',NULL,NULL,'LINE',NULL,0,'','d070f9f52befef1a1c441e3c6129b10f','',NULL),(33293,'en','default','59c578c00e60a7dd55500ffe2c1ee24d','g:i:s a',NULL,NULL,'LINE',NULL,0,'','b93f39f7edb0806afc9fe0c2564f7e93','',NULL),(33294,'en','default','0d98a24c01d792eb1923eb851e91b5ac','Draft saved at %s.',NULL,NULL,'LINE',NULL,0,'','e2d21b00dcda3969be1aeb3648136fdc','',NULL),(33295,'en','default','339aaf6f96935365023a6e4c95c0ba95','Last page',NULL,NULL,'LINE',NULL,0,'','080aa02cd14d37db7557900b63234778','',NULL),(33297,'en','default','76e10f755c0d0528adf02932ea500746','Send Trackbacks',NULL,NULL,'LINE',NULL,0,'','bbdbb2efb2634466e433fce39f47fb20','',NULL),(33298,'en','default','4388af50e061814a34b6819900fa73bd','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.',NULL,NULL,'LINE',NULL,0,'','09c81985949e99d25352c4eacbc7d9b2','',NULL),(33299,'en','default','7a1ec4645803101d4939e9d3b13ab26d','Customizing This Display',NULL,NULL,'LINE',NULL,0,'','be785ebfbe35e1089059bde74ea2968c','',NULL),(33300,'en','default','2d08934c32876d0e82311f1741b4e5cb','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.',NULL,NULL,'LINE',NULL,0,'','caebf199686f82f701abc47dd032baad','',NULL),(33301,'en','default','91cc965a84f790ad2906d697f3119a1d','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.',NULL,NULL,'LINE',NULL,0,'','a0bfc377e504c07ae3b7b4ee7eb27344','',NULL),(33302,'en','default','955b443a4e12851197c58128d813c1ad','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.',NULL,NULL,'LINE',NULL,0,'','0742cd7bdba1eb1a84f296c900ab1bf1','',NULL),(33303,'en','default','2bc6f983917576292a23bcbf9c5ecf74','The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.',NULL,NULL,'LINE',NULL,0,'','6822422cfd888b5560ab16ce486fcf0f','',NULL),(33304,'en','default','de8768b94597e0280a0f1177f2e46900','You can insert media files by clicking the icons above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.',NULL,NULL,'LINE',NULL,0,'','c495912a27038b213ad535fd59f27db5','',NULL),(33305,'en','default','d5fb0f5d059e20b79f51ba2cb67696b2','You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.',NULL,NULL,'LINE',NULL,0,'','dda7292d6cc6432d85981a7dcd8632bc','',NULL),(33306,'en','default','a8b21781fa7e22f95de425ebc0c8aa37','Keyboard users: When you&#8217;re working in the visual editor, you can use <kbd>Alt + F10</kbd> to access the toolbar.',NULL,NULL,'LINE',NULL,0,'','e901e1db104415c51215b85c60c4835b','',NULL),(33307,'en','default','3cd476936cc7b8e9d2b56dd0ef353ae3','Title and Post Editor',NULL,NULL,'LINE',NULL,0,'','b8b9703f0ca48b495552f41029e80cae','',NULL),(33308,'en','default','464b4a78bca01186db0bc144f178c5f1','You can also create posts with the <a href=\"%s\">Press This bookmarklet</a>.',NULL,NULL,'LINE',NULL,0,'','d0528ae0c11e8490f10c23327b15cafe','',NULL),(33309,'en','default','84131067cbd4621ab735600372fe06a5','<a href=\"https://codex.wordpress.org/Posts_Add_New_Screen\">Documentation on Writing and Editing Posts</a>',NULL,NULL,'LINE',NULL,0,'','99d628390ea881f30d379221d4b5b3c9','',NULL),(33310,'en','default','d2eb06f812c02052bd85e9a0cf64e63c','Several boxes on this screen contain settings for how your content will be published, including:',NULL,NULL,'LINE',NULL,0,'','bdd00e4dc7b125be80afef3e9209657a','',NULL),(33311,'en','default','ad831971b7a4b43e2ef0d627e297902a','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.',NULL,NULL,'LINE',NULL,0,'','ffea9d2f9ee57d2e3ab4a669c39607c5','',NULL),(33312,'en','default','1d667c275a75b28bd9a3d3befcc8d270','<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href=\"https://codex.wordpress.org/Post_Formats#Supported_Formats\">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.',NULL,NULL,'LINE',NULL,0,'','a802c479a057bc8c8d3892f320b37b76','',NULL),(33313,'en','default','2e9457fe36435e48a296c4a614e71a4f','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.',NULL,NULL,'LINE',NULL,0,'','3006d7934608817a28a556e753065609','',NULL),(33314,'en','default','d6ce148cfd01c369f1b23045e489b491','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.',NULL,NULL,'LINE',NULL,0,'','0671b4a2f6125c4f545933974afb647d','',NULL),(33315,'en','default','72a914bd12c78373873416f57b033b13','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.',NULL,NULL,'LINE',NULL,0,'','feb178d959aae886b2dde85248492051','',NULL),(33316,'en','default','0ad65166d12f78bc07417e0ef6d67a94','Discussion Settings',NULL,NULL,'LINE',NULL,0,'','e0beb45b13f598d5797fddee61690000','',NULL),(33317,'en','default','827d99ce3804f3fa159ea2a270382abc','Stick this post to the front page',NULL,NULL,'LINE',NULL,0,'','8c15114e713ddacc46ecddcd0202cb99','',NULL),(33318,'en','default','f79ff6c219659d9e8295baac62fad397','Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href=\"%s\">Learn more about manual excerpts</a>.',