65c988f12aa480737cab9685e','Confirm use of potentially weak password',NULL,NULL,'LINE',NULL,0,'','f94bc571da6ecd35f8ab04187994664b','',NULL),(34725,'en','default','e274c4684d61c23f3c28f17d72b4118f','Additional Capabilities',NULL,NULL,'LINE',NULL,0,'','0aa3c7eb43a1afecb81d58f2143c7029','',NULL),(34726,'en','default','82ec2cd6fda87713f588da75c3b1d0ed','Capabilities',NULL,NULL,'LINE',NULL,0,'','d18b8f49d888b1f57acdaf6891af0987','',NULL),(34727,'en','default','6b1603ac9dd7ae4de8399b2fa0801696','Update User',NULL,NULL,'LINE',NULL,0,'','bee92e73d15909f939028f6a332d15fc','',NULL),(34730,'en','default','5ce536c11257afbcd860a39de740b3ac','Hi ###USERNAME###,\n\nThis notice confirms that your password was changed on ###SITENAME###.\n\nIf you did not change your password, please contact the Site Administrator at\n###ADMIN_EMAIL###\n\nThis email has been sent to ###EMAIL###\n\nRegards,\nAll at ###SITENAME###\n###SITEURL###',NULL,NULL,'LINE',NULL,0,'','65ecabcb12771115b6ff0c308f9ce471','',NULL),(34731,'en','default','4f96445eea3b979fd58c894909e79b8e','[%s] Notice of Password Change',NULL,NULL,'LINE',NULL,0,'','4a42a0bd32237b0e73ab667efbfe36c8','',NULL),(34732,'en','default','aae0119acf904da3679588fcacc02521','User updated.',NULL,NULL,'LINE',NULL,0,'','5be08f9e8de7ae98c674fb2e1ace1263','',NULL),(34733,'en','default','24e6cb545c9daae44a3b60d6c84f89ab','&larr; Back to Users',NULL,NULL,'LINE',NULL,0,'','dc1d5e6aa37aeaf45ef1b88de8cdf932','',NULL),(34734,'en','contact-form-7','3b878279a04dc47d60932cb294d96259','Overview',NULL,NULL,'LINE',NULL,0,'','fd6c11f271e7faa4b921122d984b4940','',NULL),(34735,'en','contact-form-7','2c83a4000ea2728d74ebbdc01df343e5','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.',NULL,NULL,'LINE',NULL,0,'','b19a78247936d588751be9ac139fb86b','',NULL),(34736,'en','contact-form-7','6215de4d22a94076f05c6e81be82bda5','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:',NULL,NULL,'LINE',NULL,0,'','9b37ca1ff888857fe120aeeb21dfc3af','',NULL),(34737,'en','contact-form-7','4ef427b4f52b8def1ff6563e403ad0aa','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.',NULL,NULL,'LINE',NULL,0,'','ea76c2469f54366347c0d04fef3cec30','',NULL),(34738,'en','contact-form-7','a6fdca11cd20cd9feabece957bfcadbb','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.',NULL,NULL,'LINE',NULL,0,'','b6e099df716ba84aada7287dc8cc23f6','',NULL),(34739,'en','contact-form-7','5ac6fe836e5d92c56a8bc5af7a7fb064','On this screen, you can edit a contact form. A contact form is comprised of the following components:',NULL,NULL,'LINE',NULL,0,'','d64bcf4d957d8dafed61478b3251ca01','',NULL),(34740,'en','contact-form-7','8d44de43f8128813c4341ae759f1bc2b','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.',NULL,NULL,'LINE',NULL,0,'','c5ed9c58ac7509b05ae78d439c77a948','',NULL),(34741,'en','contact-form-7','a25ed68c9a8e9cf1208dc06da5ca9e6d','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.',NULL,NULL,'LINE',NULL,0,'','5880875d721835f16410b86d5cd8c14b','',NULL),(34742,'en','contact-form-7','4573c02dd1f6585f8da85e5d065de084','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.',NULL,NULL,'LINE',NULL,0,'','74eac5df9f32c130fc7f777145142e33','',NULL),(34743,'en','contact-form-7','ee9be757d9d1fc5edf191c10af054b55','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.',NULL,NULL,'LINE',NULL,0,'','322cb620832476ea07856f78699980a3','',NULL),(34744,'en','contact-form-7','955bb3321521ccc87f036e72c91334b7','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.',NULL,NULL,'LINE',NULL,0,'','2ee2f112f68da8d90881ff028fcf5cad','',NULL),(34745,'en','contact-form-7','90e98b3c13f62af6edadcf1cb8a1f8ac','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.',NULL,NULL,'LINE',NULL,0,'','e2e610466e43a4c2aafbb91a66c2d2b1','',NULL),(34746,'en','contact-form-7','cf1e52339d6aabd416f1b9706826c14a','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.',NULL,NULL,'LINE',NULL,0,'','b1969d732ba400a04aa90bfb6c1e962b','',NULL),(34747,'en','contact-form-7','89a963521b520e09ea94ad49340f64b8','While form-tags have a comparatively complex syntax, you don&#8217;t need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).',NULL,NULL,'LINE',NULL,0,'','1abe194b2bd158d6c5a1372abf8f7d2e','',NULL),(34748,'en','contact-form-7','f203d7bf1700903f826c0648ca8c84ac','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.',NULL,NULL,'LINE',NULL,0,'','64b230e8e0b79669dc0a20ced17e0ce7','',NULL),(34749,'en','contact-form-7','7a8ccf0c41083f3f91e2f598329a7ae4','There are also special mail-tags that have specific names, but don&#8217;t have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.',NULL,NULL,'LINE',NULL,0,'','31d8d53e900bbbaf4ad328ce81d17782','',NULL),(34750,'en','contact-form-7','b2edd70cc3b3b06f1d86330604b538ec','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.',NULL,NULL,'LINE',NULL,0,'','4aa6b549538b6d0b009bdb01a0ae00c0','',NULL),(34751,'en','contact-form-7','815f676fd88b86d426d176caceb64d3f','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.',NULL,NULL,'LINE',NULL,0,'','ab3df08afc2ca1b290d81243de7b3ae2','',NULL),(34752,'en','contact-form-7','31c59d9d16d6749158364cb69e5ff108','Any information you provide will not be shared with service providers without your authorization.',NULL,NULL,'LINE',NULL,0,'','1cb37c99ceb86b6bb955208418a905d4','',NULL),(34753,'en','contact-form-7','0f05ceec0844c366727708a4f37bc8d4','Available Actions',NULL,NULL,'LINE',NULL,0,'','da885e7d3a16dc303c0f8c9a19c15e6c','',NULL),(34754,'en','contact-form-7','55707b4848b3a26a39057e3af6948b43','For more information:',NULL,NULL,'LINE',NULL,0,'','fe3d0c24609149b20a0c8125e42e3df6','',NULL),(34755,'en','contact-form-7','a110a649cc42247f624d5fc823396724','https://contactform7.com/docs/',NULL,NULL,'LINE',NULL,0,'','bc8be92c601d3e8d46f517e72da5a1fa','',NULL),(34756,'en','contact-form-7','a3907cd461d8739aa3266047bc4b8c0c','Docs',NULL,NULL,'LINE',NULL,0,'',