ec votre propre contenu. Amusez-vous bien !'),(24,10,'_et_pb_enable_shortcode_tracking',''),(25,10,'_et_pb_custom_css',''),(26,10,'_et_pb_built_for_post_type','page'),(27,10,'_et_pb_use_ab_testing','off'),(28,10,'_et_pb_dark_text_color','#000000'),(29,10,'_et_pb_ab_current_shortcode','[et_pb_split_track id=\"2\" /]'),(30,10,'_et_pb_color_palette','#000000|#ffffff|#e02b20|#e09900|#edf000|#7cda24|#0c71c3|#8300e9'),(31,10,'_et_pb_gutter_width','1'),(32,10,'_wp_trash_meta_status','publish'),(33,10,'_wp_trash_meta_time','1535557352'),(34,10,'_wp_desired_post_slug','page-d-exemple'),(35,11,'_wp_page_template','default'),(36,21,'_et_pb_old_content',''),(37,21,'_et_pb_ab_stats_refresh_interval','hourly'),(38,21,'_edit_last','1'),(39,21,'_et_pb_use_builder',''),(40,21,'_et_builder_version','BB|Divi|3.8'),(41,21,'_et_pb_enable_shortcode_tracking',''),(42,21,'_et_pb_custom_css',''),(43,21,'et_enqueued_post_fonts','a:2:{s:6:\"family\";a:1:{s:20:\"et-gf-palanquin-dark\";s:34:\"Palanquin+Dark:regular,500,600,700\";}s:6:\"subset\";a:2:{i:0;s:5:\"latin\";i:1;s:9:\"latin-ext\";}}'),(44,21,'_wp_page_template','page-templates/tpl-home.php'),(45,23,'_edit_last','1'),(46,23,'_et_pb_use_builder','off'),(47,23,'_et_builder_version','BB|Divi|3.12.2'),(48,23,'_et_pb_ab_stats_refresh_interval','hourly'),(49,23,'_et_pb_old_content',''),(50,23,'_et_pb_enable_shortcode_tracking',''),(51,23,'_et_pb_custom_css',''),(52,23,'_wp_page_template','page-templates/tpl-echanger.php'),(54,25,'_wp_page_template','page-templates/page-full.php'),(56,25,'_edit_last','1'),(57,25,'_et_pb_use_builder','off'),(58,25,'_et_builder_version','BB|Divi|3.12.2'),(59,25,'_et_pb_ab_stats_refresh_interval','hourly'),(60,25,'_et_pb_old_content',''),(61,25,'_et_pb_enable_shortcode_tracking',''),(62,25,'_et_pb_custom_css',''),(63,25,'_et_pb_built_for_post_type','page'),(64,25,'_et_pb_use_ab_testing','off'),(65,25,'_et_pb_ab_current_shortcode','[et_pb_split_track id=\"25\" /]'),(66,27,'_wp_page_template','page-templates/inform