s pages avec votre propre contenu. Amusez-vous bien !'),(263,10,'_et_pb_enable_shortcode_tracking',''),(264,10,'_et_pb_custom_css',''),(265,10,'_et_pb_built_for_post_type','page'),(266,10,'_et_pb_use_ab_testing','off'),(267,10,'_et_pb_dark_text_color','#000000'),(268,10,'_et_pb_ab_current_shortcode','[et_pb_split_track id=\"2\" /]'),(269,10,'_et_pb_color_palette','#000000|#ffffff|#e02b20|#e09900|#edf000|#7cda24|#0c71c3|#8300e9'),(270,10,'_et_pb_gutter_width','1'),(271,10,'_wp_trash_meta_status','publish'),(272,10,'_wp_trash_meta_time','1535557352'),(273,10,'_wp_desired_post_slug','page-d-exemple'),(274,11,'_wp_page_template','default'),(275,21,'_et_pb_old_content',''),(276,21,'_et_pb_ab_stats_refresh_interval','hourly'),(277,21,'_edit_last','1'),(278,21,'_et_pb_use_builder',''),(279,21,'_et_builder_version','BB|Divi|3.8'),(280,21,'_et_pb_enable_shortcode_tracking',''),(281,21,'_et_pb_custom_css',''),(282,21,'et_enqueued_post_fonts','a:2:{s:6:\"family\";a:1:{s:20:\"et-gf-palanquin-dark\";s:34:\"Palanquin+Dark:regular,500,600,700\";}s:6:\"subset\";a:2:{i:0;s:5:\"latin\";i:1;s:9:\"latin-ext\";}}'),(283,21,'_wp_page_template','page-templates/tpl-home.php'),(284,23,'_edit_last','1'),(285,23,'_et_pb_use_builder','off'),(286,23,'_et_builder_version','BB|Divi|3.12.2'),(287,23,'_et_pb_ab_stats_refresh_interval','hourly'),(288,23,'_et_pb_old_content',''),(289,23,'_et_pb_enable_shortcode_tracking',''),(290,23,'_et_pb_custom_css',''),(291,23,'_wp_page_template','page-templates/tpl-echanger.php'),(293,25,'_wp_page_template','page-templates/page-full.php'),(294,25,'_et_pb_show_page_creation','off'),(295,25,'_edit_last','3'),(296,25,'_et_pb_use_builder','on'),(297,25,'_et_builder_version','BB|Divi|3.8'),(298,25,'_et_pb_ab_stats_refresh_interval','hourly'),(299,25,'_et_pb_old_content',''),(300,25,'_et_pb_enable_shortcode_tracking',''),(301,25,'_et_pb_custom_css',''),(302,25,'_et_pb_built_for_post_type','page'),(303,25,'_et_pb_use_ab_testing','off'),(304,25,'_et_pb_ab_current_shortc