INSERT INTO `wp_posts` VALUES (1,1,'2018-09-20 07:20:55','2018-09-20 07:20:55','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world__trashed','','','2018-09-25 06:40:57','2018-09-25 06:40:57','',0,'http://dev.c-e-a.asso.fr/?p=1',0,'post','',1),(2,1,'2018-09-20 07:20:55','2018-09-20 07:20:55','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://dev.c-e-a.asso.fr/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-09-20 07:20:55','2018-09-20 07:20:55','',0,'http://dev.c-e-a.asso.fr/?page_id=2',0,'page','',0),(3,1,'2018-09-20 07:20:55','2018-09-20 07:20:55','<h2>Who we are</h2><p>Our website address is: http://dev.c-e-a.asso.fr.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','draft','closed','open','','privacy-policy','','','2018-09-20 07:20:55','2018-09-20 07:20:55','',0,'http://dev.c-e-a.asso.fr/?page_id=3',0,'page','',0),(4,1,'2018-09-20 07:21:07','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-09-20 07:21:07','0000-00-00 00:00:00','',0,'http://dev.c-e-a.asso.fr/?p=4',0,'post','',0),(5,1,'2018-09-20 09:21:47','2018-09-20 09:21:47','<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\nC-E-A \"[your-subject]\"\n[your-name] <wordpress@dev.c-e-a.asso.fr>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on C-E-A (http://dev.c-e-a.asso.fr)\nerreure@gmail.com\nReply-To: [your-email]\n\n0\n0\n\nC-E-A \"[your-subject]\"\nC-E-A <wordpress@dev.c-e-a.asso.fr>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on C-E-A (http://dev.c-e-a.asso.fr)\n[your-email]\nReply-To: erreure@gmail.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.','Contact form 1','','publish','closed','closed','','contact-form-1','','','2018-09-20 09:21:47','2018-09-20 09:21:47','',0,'http://dev.c-e-a.asso.fr/?post_type=wpcf7_contact_form&p=5',0,'wpcf7_contact_form','',0),(6,1,'2018-09-20 09:40:19','0000-00-00 00:00:00','','Brouillon auto','','auto-draft','closed','closed','','','','','2018-09-20 09:40:19','0000-00-00 00:00:00','',0,'http://dev.c-e-a.asso.fr/?post_type=acf-field-group&p=6',0,'acf-field-group','',0),(7,1,'2018-09-20 09:47:59','2018-09-20 09:47:59','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:7:\"groupes\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:12:{i:0;s:11:\"the_content\";i:1;s:7:\"excerpt\";i:2;s:10:\"discussion\";i:3;s:8:\"comments\";i:4;s:9:\"revisions\";i:5;s:4:\"slug\";i:6;s:6:\"format\";i:7;s:15:\"page_attributes\";i:8;s:14:\"featured_image\";i:9;s:10:\"categories\";i:10;s:4:\"tags\";i:11;s:15:\"send-trackbacks\";}s:11:\"description\";s:0:\"\";}','Groupes de Travail','groupes-de-travail','publish','closed','closed','','group_5ba36c8f659f6','','','2018-09-21 13:24:32','2018-09-21 13:24:32','',0,'http://dev.c-e-a.asso.fr/?post_type=acf-field-group&#038;p=7',0,'acf-field-group','',0),(10,1,'2018-06-15 18:11:41','2018-06-15 16:11:41','[et_pb_section fb_built=\"1\" _builder_version=\"3.8\"][et_pb_row border_radii=\"on|1px|1px|1px|1px\" _builder_version=\"3.8\"][et_pb_column type=\"1_3\" _builder_version=\"3.8\" parallax=\"off\" parallax_method=\"on\"][et_pb_cta title=\"Your Title Goes Here\" button_text=\"Click Here\" _builder_version=\"3.8\"]\n\n<img class=\"wp-image-10 alignnone size-medium\" src=\"http://bitumas.com/cea/wp-content/uploads/2018/06/3r151_012-300x246.jpg\" alt=\"\" width=\"300\" height=\"246\" />Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.\n\n[/et_pb_cta][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.8\" parallax=\"off\" parallax_method=\"on\"][et_pb_cta title=\"Your Title Goes Here\" button_text=\"Click Here\" _builder_version=\"3.8\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_cta][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.8\" parallax=\"off\" parallax_method=\"on\"][et_pb_cta title=\"Your Title Goes Here\" button_text=\"Click Here\" _builder_version=\"3.8\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_cta][/et_pb_column][/et_pb_row][/et_pb_section]','Page d’exemple','','trash','closed','open','','page-d-exemple__trashed','','','2018-06-15 18:11:41','2018-06-15 16:11:41','',0,'http://bitumas.com/cea/?page_id=2',0,'page','',0),(11,1,'2018-06-15 18:11:41','2018-06-15 16:11:41','<h2>Qui sommes-nous ?</h2><p>L’adresse de notre site Web est : http://bitumas.com/cea.</p><h2>Utilisation des données personnelles collectées</h2><h3>Commentaires</h3><p>Quand vous laissez un commentaire sur notre site web, les données inscrites dans le formulaire de commentaire, mais aussi votre adresse IP et l’agent utilisateur de votre navigateur sont collectés pour nous aider à la détection des commentaires indésirables.</p><p>Une chaîne anonymisée créée à partir de votre adresse de messagerie (également appelée hash) peut être envoyée au service Gravatar pour vérifier si vous utilisez ce dernier. Les clauses de confidentialité du service Gravatar sont disponibles ici : https://automattic.com/privacy/. Après validation de votre commentaire, votre photo de profil sera visible publiquement à coté de votre commentaire.</p><h3>Médias</h3><p>Si vous êtes un utilisateur ou une utilisatrice enregistré·e et que vous téléversez des images sur le site web, nous vous conseillons d’éviter de téléverser des images contenant des données EXIF de coordonnées GPS. Les visiteurs de votre site web peuvent télécharger et extraire des données de localisation depuis ces images.</p><h3>Formulaires de contact</h3><h3>Cookies</h3><p>Si vous déposez un commentaire sur notre site, il vous sera proposé d’enregistrer votre nom, adresse de messagerie et site web dans des cookies. C’est uniquement pour votre confort afin de ne pas avoir à saisir ces informations si vous déposez un autre commentaire plus tard. Ces cookies expirent au bout d’un an.</p><p>Si vous avez un compte et que vous vous connectez sur ce site, un cookie temporaire sera créé afin de déterminer si votre navigateur accepte les cookies. Il ne contient pas de données personnelles et sera supprimé automatiquement à la fermeture de votre navigateur.</p><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos préférences d’écran. La durée de vie d’un cookie de connexion est de deux jours, celle d’un cookie d’option d’écran est d’un an. Si vous cochez « Se souvenir de moi », votre cookie de connexion sera conservé pendant deux semaines. Si vous vous déconnectez de votre compte, le cookie de connexion sera effacé.</p><p>En modifiant ou en publiant un article, un cookie supplémentaire sera enregistré dans votre navigateur. Ce cookie ne comprend aucune donnée personnelle. Il indique simplement l’identifiant de l’article que vous venez de modifier. Il expire au bout d’un jour.</p><h3>Contenu embarqué depuis d’autres sites</h3><p>Les articles de ce site peuvent inclure des contenus intégrés (par exemple des vidéos, images, articles…). Le contenu intégré depuis d’autres sites se comporte de la même manière que si le visiteur se rendait sur cet autre site.</p><p>Ces sites web pourraient collecter des données sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqués si vous disposez d’un compte connecté sur leur site web.</p><h3>Statistiques et mesures d’audience</h3><h2>Utilisation et transmission de vos données personnelles</h2><h2>Durées de stockage de vos données</h2><p>Si vous laissez un commentaire, le commentaire et ses métadonnées sont conservés indéfiniment. Cela permet de reconnaître et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modération.</p><p>Pour les utilisateurs et utilisatrices qui s’enregistrent sur notre site (si cela est possible), nous stockons également les données personnelles indiquées dans leur profil. Tous les utilisateurs et utilisatrices peuvent voir, modifier ou supprimer leurs informations personnelles à tout moment (à l’exception de leur nom d’utilisateur·ice). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><h2>Les droits que vous avez sur vos données</h2><p>Si vous avez un compte ou si vous avez laissé des commentaires sur le site, vous pouvez demander à recevoir un fichier contenant toutes les données personnelles que nous possédons à votre sujet, incluant celles que vous nous avez fournies. Vous pouvez également demander la suppression des données personnelles vous concernant. Cela ne prend pas en compte les données stockées à des fins administratives, légales ou pour des raisons de sécurité.</p><h2>Transmission de vos données personnelles</h2><p>Les commentaires des visiteurs peuvent être vérifiés à l’aide d’un service automatisé de détection des commentaires indésirables.</p><h2>Informations de contact</h2><h2>Informations supplémentaires</h2><h3>Comment nous protégeons vos données</h3><h3>Procédures mises en œuvre en cas de fuite de données</h3><h3>Les services tiers qui nous transmettent des données</h3><h3>Opérations de marketing automatisé et/ou de profilage réalisées à l’aide des données personnelles</h3><h3>Affichage des informations liées aux secteurs soumis à des régulations spécifiques</h3>','Politique de confidentialité','','draft','closed','open','','politique-de-confidentialite','','','2018-06-15 18:11:41','2018-06-15 16:11:41','',0,'http://bitumas.com/cea/?page_id=3',0,'page','',0),(21,1,'2018-07-15 15:09:27','2018-07-15 13:09:27','Fondée en 2007,\r\nC-E-A | Association française des commissaires d\'exposition a pour vocation de regrouper les personnes exerçant une activité de commissaire d\'exposition d\'art contemporain en France et de constituer une plateforme de réflexion, de promotion et d\'organisation d\'actions et de projets autour de cette activité.','home','','publish','closed','closed','','home','','','2018-09-21 07:17:17','2018-09-21 07:17:17','',0,'http://bitumas.com/cea/?page_id=21',0,'page','',0),(23,1,'2018-07-15 16:39:33','2018-07-15 14:39:33','','échanger','','publish','closed','closed','','echanger','','','2018-09-25 07:45:54','2018-09-25 07:45:54','',0,'http://bitumas.com/cea/?page_id=23',0,'page','',0),(25,1,'2018-07-15 16:41:06','2018-07-15 14:41:06','','à propos','','publish','closed','closed','','a-propos','','','2018-09-20 10:01:44','2018-09-20 10:01:44','',0,'http://bitumas.com/cea/?page_id=25',0,'page','',0),(27,1,'2018-07-15 17:19:34','2018-07-15 15:19:34','hello','s\'informer','','publish','closed','closed','','sinformer','','','2018-07-15 17:19:34','2018-07-15 15:19:34','',0,'http://bitumas.com/cea/?page_id=27',0,'page','',0),(29,1,'2018-07-15 17:23:56','2018-07-15 15:23:56','<h2>Outil de création curatoriale</h2>\r\n[cea_curation_form]','curater','','publish','closed','closed','','curater','','','2018-09-23 13:32:53','2018-09-23 13:32:53','',0,'http://bitumas.com/cea/?page_id=29',1,'page','',0),(30,1,'2018-07-15 17:24:12','2018-07-15 15:24:12','','structurer','','publish','closed','closed','','structurer','','','2018-07-15 17:24:12','2018-07-15 15:24:12','',0,'http://bitumas.com/cea/?page_id=30',0,'page','',0),(33,1,'2018-07-15 17:29:06','2018-07-15 15:29:06','[et_pb_section bb_built=\"1\" _builder_version=\"3.8\" custom_margin=\"0px||0px|\" custom_padding=\"0px||0px|\"][et_pb_row _builder_version=\"3.8\" make_fullwidth=\"on\" make_equal=\"on\" padding_top_1=\"2em\" padding_right_1=\"1em\" padding_bottom_1=\"2em\" padding_left_1=\"1em\" bg_img_2=\"http://bitumas.com/cea/wp-content/uploads/2018/08/background-cea-1.png\" background_size_2=\"initial\" custom_margin=\"0px||0px|\" custom_padding=\"0px||0px|\" module_alignment=\"center\" use_custom_gutter=\"on\" gutter_width=\"1\"][et_pb_column type=\"1_2\"][et_pb_post_title _builder_version=\"3.8\" meta=\"off\" featured_image=\"off\" /][et_pb_text _builder_version=\"3.8\"]\n\nVOUS AVEZ LA POSSIBILITÉ D’ADHÉRER  A L’ASSOCIATION EN TANT QUE :\n<ol>\n 	<li><strong>Membre actif</strong> :\nPersonne physique ayant une activité de commissaire d’exposition en art contemporain, indépendante ou non, exerçant ou ayant exercé son activité sur le territoire français.\nMontant de la cotisation 2018 : à partir de 30 euros.</li>\n 	<li><strong>Membre adhérent</strong> :\nPersonne physique qui ne répond pas aux critères des membres actifs mais qui souhaite être informée des activités de C-E-A.\nMontant de la cotisation 2018 : à partir de 15 euros.</li>\n 	<li><strong>Membre bienfaiteur</strong> :\nPersonne physique ou morale qui soutient financièrement l’association.\nMontant de la cotisation 2018 : à partir de 30 euros.</li>\n</ol>\nL’adhésion est valable pour une année civile.\n\nPour devenir membre actif:\nIl faut pouvoir témoigner d’une activité dans le champ du commissariat d’exposition d’art contemporain, en tant qu’indépendant ou rattaché à une structure de diffusion. Le Conseil d’administration valide les adhésions et se réserve le droit de refuser à tout candidat le statut de membre actif qui ne correspondrait pas aux critères fixés.\nValable pour une année civile, l’adhésion en tant que membre actif offre les avantages suivants :\n<ul>\n 	<li><strong><a href=\"http://c-e-a.asso.fr/structuration-professionnelle/carte-professionnelle-c-e-a/\">Carte professionnelle</a></strong> permettant de rentrer gratuitement dans certains lieux de diffusion payants</li>\n 	<li>Réception des informations sur l’actualité des questions relatives au commissariat d’exposition : colloques, rencontres, publications etc…</li>\n 	<li>Accès au réseau des professionnels de l’association permettant d’échanger les réflexions et les expériences sur différentes questions</li>\n 	<li>Inscription dans l’annuaire en ligne</li>\n 	<li>Annonces d’offres d’emploi, résidences, workshop…</li>\n 	<li>Participation aux groupes de travail</li>\n</ul>\n&nbsp;\n\n<strong>Pour adhérer, il vous suffit de retourner le <a href=\"http://c-e-a.asso.fr/wp-content/uploads/2018/02/bulletin_adhesion_CEA_2018.pdf\">bulletin d’adhésion 2018</a> complété et signé, ainsi qu’un CV et une lettre de motivation pour les demandes de membres actifs à :</strong>\n\n&nbsp;\n\n<center>C-E-A / Association française des commissaires d’exposition\n32, rue Yves Toudic\n75010 PARIS</center>&nbsp;\n\n&nbsp;\n\n[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\"][/et_pb_column][/et_pb_row][/et_pb_section]','adhérer','','publish','closed','closed','','adherer','','','2018-07-15 17:29:06','2018-07-15 15:29:06','',0,'http://bitumas.com/cea/?page_id=33',0,'page','',0),(35,1,'2018-07-15 17:35:21','2018-07-15 15:35:21','[et_pb_section bb_built=\"1\" _builder_version=\"3.8\" custom_margin=\"0px||0px|\" custom_padding=\"0px||0px|\"][et_pb_row _builder_version=\"3.8\" module_alignment=\"center\" make_fullwidth=\"on\" use_custom_gutter=\"on\" gutter_width=\"1\" make_equal=\"on\" custom_margin=\"0px||0px|\" custom_padding=\"0px||0px|\" padding_top_1=\"1em\" padding_right_1=\"1em\" padding_bottom_1=\"1em\" padding_left_1=\"1em\" background_size_2=\"initial\" module_class_2=\"border-left\" padding_top_2=\"1em\" padding_right_2=\"1em\" padding_bottom_2=\"1em\" padding_left_2=\"1em\"][et_pb_column type=\"1_2\"][et_pb_social_media_follow _builder_version=\"3.8\"][et_pb_social_media_follow_network _builder_version=\"3.8\" social_network=\"facebook\" skype_action=\"call\" url=\"https://www.facebook.com/cea.asso\" background_color=\"#3b5998\" use_background_color_gradient=\"off\" background_color_gradient_start=\"#2b87da\" background_color_gradient_end=\"#29c4a9\" background_color_gradient_type=\"linear\" background_color_gradient_direction=\"180deg\" background_color_gradient_direction_radial=\"center\" background_color_gradient_start_position=\"0%\" background_color_gradient_end_position=\"100%\" background_color_gradient_overlays_image=\"off\" parallax=\"off\" parallax_method=\"on\" background_size=\"cover\" background_position=\"center\" background_repeat=\"no-repeat\" background_blend=\"normal\" allow_player_pause=\"off\" background_video_pause_outside_viewport=\"on\" box_shadow_style=\"none\"] Facebook [/et_pb_social_media_follow_network][et_pb_social_media_follow_network _builder_version=\"3.8\" social_network=\"instagram\" skype_action=\"call\" url=\"https://www.instagram.com/ceacommissaires/?hl=fr\" background_color=\"#ea2c59\" use_background_color_gradient=\"off\" background_color_gradient_start=\"#2b87da\" background_color_gradient_end=\"#29c4a9\" background_color_gradient_type=\"linear\" background_color_gradient_direction=\"180deg\" background_color_gradient_direction_radial=\"center\" background_color_gradient_start_position=\"0%\" background_color_gradient_end_position=\"100%\" background_color_gradient_overlays_image=\"off\" parallax=\"off\" parallax_method=\"on\" background_size=\"cover\" background_position=\"center\" background_repeat=\"no-repeat\" background_blend=\"normal\" allow_player_pause=\"off\" background_video_pause_outside_viewport=\"on\" box_shadow_style=\"none\"] Instagram [/et_pb_social_media_follow_network][/et_pb_social_media_follow][/et_pb_column][et_pb_column type=\"1_2\"][et_pb_text _builder_version=\"3.8\"]\n<h2 class=\"serif\" style=\"text-align: center;\"><strong>C-E-A </strong></h2>\n<h2 class=\"serif\" style=\"text-align: center;\"><strong>Association française des commissaires d’exposition</strong></h2>\n<h4 style=\"text-align: center;\">Adresse postale / Siège social :</h4>\n<p style=\"text-align: center;\">32, rue Yves Toudic\n75010 Paris\nFrance</p>\nmail: <strong><a title=\"mailto:info@c-e-a.asso.fr\" href=\"mailto:info@c-e-a.asso.fr\">info@c-e-a.asso.fr</a></strong>\n\nCoordinatrice: Juliette Courtillier\n<strong><a href=\"mailto:juliette.courtillier@c-e-a.asso.fr\">juliette.courtillier@c-e-a.asso.fr</a></strong>\n\n[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]','contact','','publish','closed','closed','','contact','','','2018-07-15 17:35:21','2018-07-15 15:35:21','',0,'http://bitumas.com/cea/?page_id=35',0,'page','',0),(65,1,'2018-08-22 10:55:45','2018-08-22 08:55:45','','découvrir','','publish','closed','closed','','decouvrir','','','2018-08-22 10:55:45','2018-08-22 08:55:45','',0,'http://bitumas.com/cea/?page_id=65',0,'page','',0),(81,3,'2018-08-22 18:25:41','2018-08-22 16:25:41','[et_pb_post_title _builder_version=\"3.8\" meta=\"off\" featured_image=\"off\" text_orientation=\"center\" title_text_align=\"center\" title_font=\"|700|||||||\" title_font_size=\"48px\" title_font_size_phone=\"46px\" title_font_size_last_edited=\"on|phone\" saved_tabs=\"all\" template_type=\"module\" /]','Titre','','publish','closed','closed','','titre','','','2018-08-22 18:25:41','2018-08-22 16:25:41','',0,'http://bitumas.com/cea/et_pb_layout/titre/',0,'et_pb_layout','',0),(107,1,'2018-08-23 10:01:15','2018-08-23 08:01:15','','actualités','','publish','closed','closed','','actualites','','','2018-08-23 10:01:15','2018-08-23 08:01:15','',65,'http://bitumas.com/cea/?page_id=107',0,'page','',0),(109,1,'2018-08-23 10:01:37','2018-08-23 08:01:37','','archives','','publish','closed','closed','','archives','','','2018-08-23 10:01:37','2018-08-23 08:01:37','',65,'http://bitumas.com/cea/?page_id=109',0,'page','',0),(126,3,'2018-07-24 11:53:36','2018-07-24 09:53:36','Curatrices, curators,\n\nChers membres,\n\nVous avez un projet que vous souhaitez soumettre à <strong>C | E | A</strong>, l’association française des commissaires d’exposition ? Afin d’accompagner votre présentation de projet, nous vous invitons à compléter la fiche d’intention ci-après à l’aune des informations que vous avez déjà. Cela permettra d’initier un échange avec les membres du bureau de l’association. Notre président, Jérôme Côtinet-Alphaize (<strong><a href=\"mailto:jerome.cotinet.alphaize@gmail.com\">jerome.cotinet.alphaize@gmail.com</a></strong>) sera ravi de vous renseigner à ce sujet, ou bien tout membre de l’association avec lequel vous êtes en contact. Nous vous inviterons dans un second temps à présenter ce projet de vive voix aux membres, lors d’un conseil d’administration.\n\n<strong><a href=\"http://c-e-a.asso.fr/wp-content/uploads/2018/07/18-fiche-intention-ok1.pdf\">Télécharger la fiche intention</a></strong>\n\nRetrouver la fiche sur le site de C-E-A dans la rubrique Groupe de travail, <strong><a href=\"http://c-e-a.asso.fr/a-propos/groupes-de-travail/\">ici</a></strong>.\nVous pouvez intégrer un groupe de travail existant ou en créer un.\n\nNous nous réjouissons de vous lire et échanger avec vous prochainement.','Vous avez un projet?','','publish','closed','closed','','vous-avez-un-projet','','','2018-07-24 11:53:36','2018-07-24 09:53:36','',0,'http://bitumas.com/cea/?p=126',0,'post','',0),(128,3,'2018-07-23 12:29:50','2018-07-23 10:29:50','Ephèbe d’Anticythère, Aphrodite de Mahdia, bronzes de Riace, Apoxyomène de Lošinj : les nombreuses statues remontées d’épaves attestent que les œuvres d’art se déplacent depuis l’Antiquité.\nPour les artistes, commissaires ou critiques, le mode privilégié de <strong>déplacement </strong>est la <strong>résidence </strong>: pour un temps plus ou moins long, il s’agit de faire l’expérience d’un autre atelier, d’arpenter d’autres paysages, d’entrer en contact avec une autre scène. La <strong>distance </strong>prise avec le contexte de départ réorganise le processus créatif et autorise une insularité d’<strong>hétérotopie</strong> autant que les frottements du <strong>voisinage</strong>.\nLe bénéfice supposé de ce dépaysement, de cette altérité et de cette étrangèreté nouvelles réside dans un enrichissement des références et des cadres du travail créatif. C’est ainsi pour produire autrement que l’artiste part en résidence.\nLes <strong>exils </strong>d’autres travailleu•r•se•s et de réfugié•e•s politiques invitent à envisager aujourd’hui d’une façon radicale la notion de <strong>frontière</strong>, et à élaborer une réflexion active sur le <strong>dépassement</strong> des lignes de démarcation entre l’art et la vie, entre les <strong>espaces</strong>, entre les médiums, entre les individus, entre les peuples : c’est le chemin sur lequel s’engage cette 5e édition de PUBLIC POOL.\n\nUne proposition de Jean-Christophe Arcos, Madeleine Filippi, Marie Gayet.','PUBLIC POOL #5 « voisinages » — 22 septembre | Cité internationale des arts','','publish','open','open','','save-the-date-public-pool-5-voisinages-22-septembre-cite-internationale-des-arts','','','2018-07-23 12:29:50','2018-07-23 10:29:50','',0,'http://bitumas.com/cea/?p=128',0,'post','',0),(138,3,'2018-08-23 15:40:45','2018-08-23 13:40:45','<strong>Application deadline – Wednesday 8 August 2018</strong>\n\nEstablished in 2009, Nottingham Contemporary’s Public Programme is a pioneering three-way partnership between Nottingham Contemporary, Nottingham Trent University and the University of Nottingham.\n\nNottingham Contemporary’s Public Programme consists of more than 100 free-to-attend public events each year. These events include: screenings, performances, workshops, symposia, and publishing practices. The Programme explores each of Nottingham Contemporary’s Exhibition’s ideas, contemporary cultural and political debates, as well as long-term research strands about critical curatorial practices, visual cultures and postcolonial debates.\n\nThe Programme is committed to connecting the interests of our local community with current debates from across the globe, whilst also engaging with practice-based research, exploring new modes of inquiry in the cultural sector in collaboration with academics and cultural practitioners.\n\nWe are now looking for an experienced and enthusiastic Curator who will work closely with the Head of Public Programmes and Research to support the strategic development of our offer. The Curator of Public Programmes will develop and manage our series of events with the team of programmers.\n\nTo be successful in this role you will be a self-motivated, team player with experience of project management and event organisation in the cultural and academic sector. Additionally, you will have an interest in and an understanding of international contemporary art and socio-political debates, critical theory and cultural studies, and postcolonial concerns in a multi-disciplinary context.\n\n<strong><a href=\"http://www.nottinghamcontemporary.org/opportunities\">More information</a></strong>','Job opportunity – Curator of Public Programmes, Nottingham Contemporary, UK','','publish','open','open','','job-opportunity-curator-of-public-programmes-nottingham-contemporary-uk','','','2018-08-23 15:40:45','2018-08-23 13:40:45','',0,'http://bitumas.com/cea/?p=138',0,'post','',0),(141,3,'2018-06-13 16:44:10','2018-06-13 14:44:10','<em>Dans le cadre de l’exposition MEMBRAINS de Florian Sumi.</em>\n\n<strong>Conversation entre Kevin Muhlen (directeur du Casino Luxembourg – Forum d’art contemporain ), Céline Poulin (directrice du CAC Brétigny), Florian Sumi (artiste) et Lilou Vidal (commissaire d’exposition) , modérée par Damien Airault (commissaire d’exposition) pour CEA / Association française des commissaires d’exposition.</strong>\n\n« La discussion avec Kevin Muhlen, Florian Sumi et Lilou Vidal, tournera autour de la question du contexte de l’exposition et de ses objets. Plus précisément, on peut considérer l’exposition comme faisant partie d’un ensemble emboîté de poupées russes qui va de la ville, son urbanisme, son quartier, sa population à une architecture. On peut aussi considérer l’histoire ou l’aura du lieu d’accueil, ses contraintes et possibilités comme déterminantes pour la réception d’un projet artistique et donc, peut-être, pour sa construction en amont. En quoi tout cela affecte les choix de l’artiste et du commissaire et les objets qui sont montrés, la communication, la programmation et la médiation ? Le problème ne sera pas « comment convaincre de venir voir les expositions d’art contemporain? » ou d’y « participer », mais plutôt d’examiner, à partir de cas particuliers et dans le détail, différentes données de base. En amont de la discussion, chaque intervenant invité présentera sa propre perception de ces enjeux à travers des exemples concrets et notamment de l’exposition MEMBRAINS de Florian Sumi. »\n\nDamien Airault, commissaire d’exposition.','L’aura du cadre // CAC Brétigny // Juin 2018','','publish','open','open','','laura-du-cadre-cac-bretigny-juin-2018','','','2018-06-13 16:44:10','2018-06-13 14:44:10','',0,'http://bitumas.com/cea/?p=141',0,'post','',0),(147,3,'2018-06-12 18:55:21','2018-06-12 16:55:21','C-E-A propose à ses membres de participer à un voyage d’étude organisé par le CACN – Centre d’Art Contemporain de Nîmes dans le sud : à Nîmes, Montpellier, Arles et Avignon, du 5 au 7 juillet 2018.\n\nCe programme vise à rencontrer des artistes et des responsables de structures, via leurs expositions.\nCe projet est une initiative de Bertrand Riou, membre de C-E-A et directeur du CACN – Centre d’Art Contemporain de Nîmes.\n\nLe voyage est réservé uniquement aux membres de C-E-A, les participants sont :\n– Damien Airault\n– Jean-Christophe Arcos\n– Anna Tomczak\n\nPROGRAMME (en cours d’élaboration)\n\n<u><strong>Jeudi 5 juillet</strong></u>\n\nArrivée des participants souhaitée dans la journée (avant 16h) afin de les récupérer à la gare (ou à leur arrêt de covoiturage) pour les guider jusqu’à leur Airbnb.\n\nÀ partir de 18h : Vernissage <em>La synchronicité des éléments</em> au centre d’art de Nîmes.\n<strong><a href=\"https://www.cacncentredart.com/a-venir\">https://www.cacncentredart.com/a-venir</a></strong>\n\n21h : Dîner offert par le CACN avec les artistes de l’exposition.\n\n<u><strong>Vendredi 6 juillet</strong></u>\n\n10h : Rendez-vous au Carré d’Art – Musée d’art contemporain de Nîmes.\n<strong><a href=\"http://www.carreartmusee.com/fr/infos-pratiques/\">http://www.carreartmusee.com/fr/infos-pratiques/</a></strong>\n\nVisite de l’exposition Wolfgang Tillmans.\n<strong><a href=\"http://www.carreartmusee.com/fr/expositions/wolfgang-tillmans-134\">http://www.carreartmusee.com/fr/expositions/wolfgang-tillmans-134</a></strong>\n+ Project Room\n<strong><a href=\"http://www.carreartmusee.com/fr/expositions/un-desir-d-archeologie-138\">http://www.carreartmusee.com/fr/expositions/un-desir-d-archeologie-138</a></strong>\navec le directeur Jean-Marc Prévost.\n\nDéjeuner libre.\n\n13h : Rendez-vous devant le CACN. Départ pour Avignon et visite des nouvelles expositions Ellsworth Kelly + Claire Tabouret + Christian Lutz à la Collection Lambert avec Anaïs Arvis, chargée des publics.\n<strong><a href=\"http://www.collectionlambert.fr/8/expositions/a-venir.html\">http://www.collectionlambert.fr/8/expositions/a-venir.html</a></strong>\n\nPuis départ pour Arles, semaine d’ouverture des Rencontres de la Photographie.\n<strong><a href=\"https://www.rencontres-arles.com/\">https://www.rencontres-arles.com/</a></strong>\n\n17h : Visite de l’exposition En ville au Cloître Saint-Trophime avec l’artiste Baptiste Rabichon (lauréat du Prix BMW 2017 et artiste de la programmation 2019 du CACN).\n<strong><a href=\"https://www.rencontres-arles.com/fr/expositions/view/242/baptiste-rabichon\">https://www.rencontres-arles.com/fr/expositions/view/242/baptiste-rabichon</a></strong>\n\nDéambulation dans la ville et visites de plusieurs expositions avec Géraldine Dufournet, membre de C-E-A et chargée de communication à l’ENSP Arles.\n\nDîner libre\n\n<u><strong>Samedi 7 juillet</strong></u>\n\n10h30 : Rendez-vous au CACN. Départ pour Montpellier.\n\n11h30 : Mécènes du Sud – Visite privée\n<strong><a href=\"http://www.mecenesdusud.fr/article/dropping-knowledge---exposition-en-cours-a-montpellier-342.html\">http://www.mecenesdusud.fr/article/dropping-knowledge—exposition-en-cours-a-montpellier-342.html</a></strong>\nPrésentation du programme de mécénat pour les commissaires\n<strong><a href=\"http://www.mecenesdusud.fr/article/appel-a-projets-2018-montpellier---sete--commissariatdexposi-346.html\">http://www.mecenesdusud.fr/article/appel-a-projets-2018-montpellier—sete–commissariatdexposi-346.html</a></strong>\n\nDéjeuner pris en charge\n\n14h : Centre d’art La Panacée – Expositions Pope L. + Bob and Roberta Smith + Talk Show Festival. Visite avec le directeur Nicolas Bourriaud (à confirmer).\n<strong><a href=\"https://lapanacee.org/fr/expositions-dete\">https://lapanacee.org/fr/expositions-dete</a></strong>\n\n16h : FRAC Occitanie : Exposition de Jennifer Caubet. Visite avec le directeur Emmanuel Latreille.\n<strong><a href=\"https://www.frac-om.org/category/expositions/avenir/\">https://www.frac-om.org/category/expositions/avenir/</a></strong>\n\n17h : Galerie Iconoscope – Exposition de Johan Larnouhet, sur une proposition de Mickaël Roy (membre de C-E-A). Rencontre avec la galeriste Sylvie Guiraud.\n<strong><a href=\"http://www.iconoscope.fr/site/accueil/\">http://www.iconoscope.fr/site/accueil/</a></strong>\n\n17h45 : Galerie Vasistas – Exposition de Julien Garnier. Rencontre avec le galeriste Jean-Paul Guarino.\n<strong><a href=\"http://www.vasistas.org/\">http://www.vasistas.org/</a></strong>\n\nRetour à Nîmes – Compte rendu de fin de voyage puis apéritif et dîner offert par le CACN\n\n<u><strong>Dimanche 8 juillet</strong></u>\n\nRetour en train ou covoiturage depuis Nîmes.','Nîmes, Montpellier, Arles et Avignon // 5 – 7 Juillet 2018','','publish','open','open','','nimes-montpellier-arles-et-avignon-5-7-juillet-2018','','','2018-06-12 18:55:21','2018-06-12 16:55:21','',0,'http://bitumas.com/cea/?p=147',0,'post','',0),(151,3,'2018-05-17 19:04:15','2018-05-17 17:04:15','Cette rencontre rendra compte de la résidence curatoriale réalisée par Fanny Lambert à la malterie et sera l’occasion d’un dialogue sur le rôle, les conditions d’exercice de l’activité et les problématiques professionnelles des commissaires d’exposition indépendants aujourd’hui.\n\nINTERVENANTS :\n\nFanny Lambert est critique d’art et commissaire d’exposition indépendante.\nJérôme Cotinet-Alphaize est commissaire indépendant et Président de C-E-A / Association française des commissaires d’exposition.\n\n<strong><a href=\"http://www.lamalterie.com/evenement/rencontre/tout-autour-1-commissaire-dexposition-ind%C3%A9pendant?utm_source=Unknown+List&amp;utm_campaign=86f504a7b1-EMAIL_CAMPAIGN_2018_05_18&amp;utm_medium=email&amp;utm_term=0_-86f504a7b1-\" target=\"_blank\" rel=\"noopener\">Plus d’information sur le programme.</a></strong>','« Le commissaire d’exposition » // la malterie // Juin 2018','Cette rencontre rendra compte de la résidence curatoriale réalisée par Fanny Lambert à la malterie et sera l’occasion d’un dialogue sur le rôle, les conditions d’exercice de l’activité et les problématiques professionnelles des commissaires d’exposition indépendants aujourd’hui.','publish','open','open','','le-commissaire-dexposition-la-malterie-juin-2018','','','2018-05-17 19:04:15','2018-05-17 17:04:15','',0,'http://bitumas.com/cea/?p=151',0,'post','',0),(187,1,'2018-08-26 18:39:26','2018-08-26 16:39:26','<h1>annuaire</h1>\nL\'annuaire recense les membres actifs de l\'association qui souhaitent y figurer, diffuser leur contact et leur profil. L\'annuaire se nourrit au fur et à mesure des contributions.','annuaire','','publish','closed','closed','','annuaire','','','2018-08-26 18:39:26','2018-08-26 16:39:26','',27,'http://bitumas.com/cea/?page_id=187',0,'page','',0),(190,1,'2018-08-27 12:17:16','2018-08-27 10:17:16','','tpl-commissaire','','publish','closed','closed','','tpl-commissaire','','','2018-08-27 12:17:16','2018-08-27 10:17:16','',187,'http://bitumas.com/cea/?page_id=190',0,'page','',0),(192,1,'2018-08-28 09:15:41','2018-08-28 07:15:41','[et_pb_section bb_built=\"1\" _builder_version=\"3.8\" custom_margin=\"0px||0px|\" custom_padding=\"0px||0px|\"][et_pb_row _builder_version=\"3.8\" module_alignment=\"center\" make_fullwidth=\"on\" use_custom_gutter=\"on\" gutter_width=\"1\" make_equal=\"on\" custom_margin=\"0px||0px|\" custom_padding=\"0px||0px|\" module_class_2=\"padding-x padding-y border-left\" module_class_3=\"border-left\" module_class_1=\"padding-x padding-y\"][et_pb_column type=\"1_3\"][et_pb_text _builder_version=\"3.8\"]\n<h2 class=\"page-title\">Résidences et bourses</h2>\n(liste en cours de constitution)\n\n&nbsp;\n<h3>France</h3>\n<ul>\n 	<li>Kadist Art Foundation, Paris : <a href=\"http://www.kadist.org/fr/programs/all/1258\">http://www.kadist.org/fr/</a></li>\n 	<li>La Maison populaire, Montreuil : <strong><a href=\"http://www.maisonpop.fr/spip.php?article1596\">http://www.maisonpop.fr/</a></strong></li>\n 	<li>Résidence Suddenly, Seine-et-Marne : <strong><a href=\"http://www.residencesuddenly.com/\">http://www.residencesuddenly.com/</a></strong></li>\n 	<li>La Box, École nationale supérieure de Bourges : <strong><a href=\"http://www.ensa-bourges.fr/\">www.ensa-bourges.fr</a></strong></li>\n 	<li>Le CEAAC, Strasbourg : <strong><a href=\"http://ceaac.org/\">http://ceaac.org/</a></strong></li>\n 	<li>Astérides, Marseille : <strong><a href=\"http://www.asterides.org/\">http://www.asterides.org/</a></strong></li>\n 	<li>Rond-Point Projects, Marseille : <strong><a href=\"http://www.rondpointprojects.org/?page_id=104\">http://www.rondpointprojects.org/</a></strong></li>\n 	<li>L’institut Français : <strong><a href=\"http://www.institutfrancais.com/fr/mobilite-internationale-et-residences-de-createurs\">http://www.institutfrancais.com/fr/</a></strong></li>\n</ul>\nAu sein du pôle résidence, sont ouverts aux commissaires français les programmes de résidences suivants :\n<ul>\n 	<li>La Villa Kujoyama : <strong><a href=\"http://www.institutfrancais.com/fr/actualit%C3%A9s/residences-la-villa-kujoyama-2014-appel-candidature\">http://www.institutfrancais.com/fr</a></strong></li>\n 	<li>Hors-les-Murs : <strong><a href=\"http://www.institutfrancais.com/fr/actualit%C3%A9s/residences-hors-les-murs-2014\">http://www.institutfrancais.com/fr</a></strong></li>\n</ul>\nConsultez le site du CNAP et le guide <em>223 Résidences d’arts visuels en France</em>\n<strong><a href=\"http://www.cnap.fr/sites/default/files/publication/149350_223_residences_darts_visuels_en_france_-_oct2016_0.pdf\">http://www.cnap.fr/</a></strong>\n\n&nbsp;\n<h3><strong>Europe</strong></h3>\n<h4>Finlande</h4>\n<ul>\n 	<li>Hiap : <strong> <a href=\"http://www.hiap.fi/\">www.hiap.fi</a></strong></li>\n 	<li>Frame : <strong><a href=\"http://www.frame-fund.fi/\">www.frame-fund.fi</a></strong></li>\n</ul>\n<h4>Grande-Bretagne</h4>\n<ul>\n 	<li>Fluxus Fund, Fonds franco-britannique : <strong><a title=\"http://www.fluxusfund.com/projects\" href=\"http://www.fluxusfund.com/projects\">www.fluxusfund.com/projects</a></strong></li>\n</ul>\n<h4>Irlande</h4>\n<ul>\n 	<li>Context Gallery : <strong><a title=\"http://www.contextgallery.co.uk/\" href=\"http://www.contextgallery.co.uk/\">www.contextgallery.co.uk</a></strong></li>\n</ul>\n<h4>Italie:</h4>\n<ul>\n 	<li>Cittadellarte-Fondazione Pistoletto : <strong><a href=\"http://www.cittadellarte.it/\">www.cittadellarte.it/</a></strong></li>\n 	<li>Fondazione Sandretto Re Rebaudengo : <strong style=\"font-size: 0.8em; color: #000000;\"><a href=\"http://www.fsrr.org/home/\">www.fsrr.org/home</a></strong></li>\n</ul>\n&nbsp;\n<h3><strong>Dans le monde</strong></h3>\nToutes destinations:\n\nInstitut Français: <strong><a href=\"http://www.institutfrancais.com/fr/mobilite-internationale-et-residences-de-createurs\">www.institutfrancais.com/fr/mobilite-internationale-et-residences-de-createurs</a></strong>\n\nCanada\n\nFonderie Darling : <strong><a href=\"http://fonderiedarling.org/residences.html\">http://fonderiedarling.org/</a></strong>\n\nThe Banff Centre for the Arts : <strong><a title=\"http://www.banffcentre.ca/leightoncolony\" href=\"http://www.banffcentre.ca/leightoncolony\">www.banffcentre.ca/leightoncolony</a></strong>\n\nInde\n\nCuratorship Programme conceptualized by India Foundation for the Arts (IFA) in collaboration with select institutions from across the country: <strong><a href=\"http://www.indiaifa.org/\">www.indiaifa.org</a></strong>\n\nPays arabes\n\nGuide to funding opportunities for the international mobility of artists and culture professionals – Focus on 13 Arab countries : <strong><a href=\"http://on-the-move.org/news/article/16189/guide-to-mobility-funding-opportunities-focus-on/\">http://on-the-move.org</a></strong>\n\n&nbsp;\n\n<strong>Résidences en France pour commissaires étrangers</strong>\n\nParis et Ile-de-France:\n\nLa Galerie, Centre d’art contemporain de Noisy-le-Sec : <strong><a href=\"http://lagalerie-cac-noisylesec.fr/la-galerie-noisy-le-sec-curateur-en-residence/\">http://lagalerie-cac-noisylesec.fr/</a></strong>\n\nRésidences de l’Institut Français à la Cité internationale des arts : <strong><a href=\"http://www.institutfrancais.com/programmes-transversaux#\">www.institutfrancais.com/programmes-transversaux</a></strong>\n\nLe FRAC Nord-Pas de Calais : <strong><a href=\"http://www.fracnpdc.fr/?p=3395\">http://www.fracnpdc.fr/</a></strong>\n\nL’institut Français : <strong><a href=\"http://www.institutfrancais.com/fr/mobilite-internationale-et-residences-de-createurs\">http://www.institutfrancais.com/fr/</a></strong>\n\nLa Cité internationale des arts : <strong><a href=\"http://www.institutfrancais.com/fr/actualit%C3%A9s/residences-2014-la-cite-internationale-des-arts\">http://www.institutfrancais.com/fr</a></strong>\n\n[/et_pb_text][/et_pb_column][et_pb_column type=\"1_3\"][et_pb_text _builder_version=\"3.8\"]\n<h2 class=\"page-title\">Recherche et formation</h2>\n<strong>FORMATIONS</strong>\n\n• Institut National d’Histoire de l’Art\n2 rue Vivienne, 75002 Paris\nTél. : +33 (0)1 47 03 89 00 / 86 04\nCourriel : <strong><a title=\"mailto:inha@inha.fr\" href=\"mailto:inha@inha.fr\">inha@inha.fr</a></strong>\n<strong><a title=\"http://www.inha.fr\" href=\"http://www.inha.fr\">www.inha.fr</a></strong>\n\n• Ehess\nCentre de sociologie du travail et des arts\n105, bd Raspail 75006 Paris\nTel : 01 53 63 51 38\n<strong><a title=\"http://www.ehess.fr\" href=\"http://www.ehess.fr\">www.ehess.fr</a></strong>\nPatricia Falguières, professeur\n\n• Centre d’études supérieures en économie, art et communication (EAC)\n13, rue de la Grange Batelière – 75009 Paris\n01 47 70 23 83\n<strong><a title=\"mailto:paris@groupeeac.com\" href=\"mailto:paris@groupeeac.com\">paris@groupeeac.com</a></strong>\n<strong><a title=\"http://www.groupeeac.com\" href=\"http://www.groupeeac.com\">www.groupeeac.com</a></strong>\n\n• Institut d’études supérieures des arts (IESA)\n5, avenue de l’Opéra – 75001 Paris\n01 42 86 57 01\n<strong><a title=\"mailto:iesa@iesa.fr\" href=\"mailto:iesa@iesa.fr\">iesa@iesa.fr</a></strong>\n<strong><a title=\"http://www.iesa.info\" href=\"http://www.iesa.info\">www.iesa.info</a></strong>\n\n• Institut supérieur des carrières artistiques (ICART)\n61-63, rue Pierre Charron – 75008 Paris\n01 53 76 88 00\n<strong><a title=\"http://www.icartparis.com\" href=\"http://www.icartparis.com\">www.icartparis.com</a></strong>\n\n&nbsp;\n\n<strong>CURATORIAL TRAINING PROGRAMS (Sélection en Europe)</strong>\n\n• Curatorial Education Network\nOnline database\n<strong><a href=\"http://publiccurating.cont3xt.net/?p=301\">www.curatorialeducationnetwork.com</a></strong>\n\n• De Appel\nNieuwe Spiegelstraat 10\n1017 De Amsterdam – NL\n+31-20-6255 651\nResponsable : Ann Demeester / Coordinatrice : Esther Vossen\n<strong><a title=\"http://www.deappel.nl\" href=\"http://www.deappel.nl\">www.deappel.nl</a></strong>\n\n• CuratorLab\nKonstfack\nBox 3601 SE-126 27 Stockholm Sweden\n+46 8 450 42 50\nDirecteur du programme : Måns Wrange\n<strong><a title=\"http://www.konstfack.se\" href=\"http://www.konstfack.se\">www.konstfack.se</a></strong>\n\n• CCC – Critical Curatorial Cybermedia\nHaute école d’art et de design\n2, rue Général-Dufour, CH-1204 Genève\nt.+ f. +41 22 388 58 81\n<strong><a title=\"http://www.ccc-programme.org\" href=\"http://www.ccc-programme.org\">www.ccc-programme.org</a></strong>\n\n• Node, Center for curatorial studies\nWaldemarstr. 37a\n10999 Berlin\n<strong><a href=\"http://www.nodecenter.org/\">www.nodecenter.org/</a></strong>\n\n&nbsp;\n\n<strong>MASTERS (Sélection en Europe)</strong>\n\n• Master 2 professionnel Sciences et Techniques de l’exposition\nUniversité Paris I Panthéon-Sorbonne / UFR Arts Plastiques et Sciences de l’Art\n47 rue des Bergers – 75015 Paris\ntél : 01 44 07 84 40\nDirectrice du Master : Françoise Docquiert, Maître de conférences\n<strong><a href=\"http://www.univ-paris1.fr/ufr/ufr04/decouvrir-lufr-04/centre-saint-charles/\">www.univ-paris1.fr</a></strong>\n&gt; Association Paste\nL’association réunit les anciens étudiants du Master 2 professionnel Sciences et Techniques de l’Exposition\n<strong><a href=\"http://www.associationpaste.com/\">www.associationpaste.com</a></strong>\nContact : <strong><a href=\"mailto:contact@associationpaste.com\">contact@associationpaste.com</a></strong>\n\n• Master 2 professionnel Projets Culturels dans l’Espace Public\nUniversité Paris I Panthéon-Sorbonne / UFR Arts Plastiques et Sciences de l’Art\n47 rue des Bergers – 75015 Paris\ntél : 01 44 07 84 40\nDirecteur du Master : Pascal Le Brun-Cordier, Professeur associé (PAST)\n<strong><a title=\"http://www.univ-paris1.fr\" href=\"http://www.univ-paris1.fr\">www.univ-paris1.fr</a></strong>\n\n• Master 2 professionnel L’Art Contemporain et son Exposition\nUniversité Paris IV Sorbonne / UFR Histoire de l’Art et Archéologie\nInstitut d’Art et Archéologie\n3, rue Michelet, 75006 Paris, 2e étage\n01 53 73 71 41\nDirecteur du Master : Arnauld Pierre, Professeur / Responsable administrative et pédagogique : Isabelle Ewig, Maître de conférences\n<strong><a href=\"http://www.paris-sorbonne.fr/nos-formations/les-parcours/masters-professionnels-5613/masters-professionnels-archeologie/histoire-de-l-art-l-art/objectifs-de-la-formation-3877/\">http://www.paris-sorbonne.fr/</a></strong>\n\n• Master 2 Métiers et Arts de l’Exposition\nUniversité Rennes 2 – Haute Bretagne / UFR Arts, Lettres, Communication\nPlace du Recteur Henri Le Moal CS 24307, 35043 Rennes cedex\ntél : 02.99.14.15.08\nResponsable de la formation : Elvan Zabunyan\n<strong><a href=\"https://maerennes2.wordpress.com\">https://maerennes2.wordpress.com</a></strong>\n\n• Master 2 professionnel Critique-Essais\nUniversité Marc Bloch / UFR Arts\nBâtiment Le PORTIQUE, côté rue\n14 rue René Descartes 67084 Strasbourg Cedex BP 80010\n1er étage, bureau 102\ntél : 03.88.15.72.81\nResponsables de la formation : Germain Roesz  / Corinne Pencenat\n<strong><a href=\"http://www-umb.u-strasbg.fr\">www-umb.u-strasbg.fr</a></strong>\n\n• MA Curating Contemporary Art\nRoyal College of Art\nKensington Gore\nLondon SW7 2EU – UK\n+44(0)207 590 4494\nAdministratrice de la formation : Fiona Key\n<strong><a title=\"http://www.rca.ac.uk\" href=\"http://www.rca.ac.uk\">www.rca.ac.uk</a></strong>\n\n• MFA Curating\nGoldsmiths University of London\nNew Cross\nLondon SE14 6NW – UK\n+44 20 7919 7171\nContact : Andrea Phillips\n<strong><a title=\"http://www.goldsmiths.ac.uk\" href=\"http://www.goldsmiths.ac.uk\">www.goldsmiths.ac.uk</a></strong>\n\n[/et_pb_text][/et_pb_column][et_pb_column type=\"1_3\"][et_pb_post_slider _builder_version=\"3.8\" include_categories=\"8\" use_text_overlay=\"off\" posts_number=\"10\" show_meta=\"off\" show_image=\"off\" background_color=\"#000000\" /][/et_pb_column][/et_pb_row][/et_pb_section]','ressources','','publish','closed','closed','','ressources','','','2018-08-28 09:15:41','2018-08-28 07:15:41','',27,'http://bitumas.com/cea/?page_id=192',0,'page','',0),(196,3,'2018-08-28 09:58:42','2018-08-28 07:58:42','<p>[et_pb_section bb_built=\"1\"][et_pb_row _builder_version=\"3.8\" module_alignment=\"center\" make_full