ed','','318-revision-v1','','','2018-09-24 13:36:50','2018-09-24 13:36:50','',318,'http://dev.c-e-a.asso.fr/318-revision-v1/',0,'revision','',0),(321,1,'2018-09-24 13:55:33','2018-09-24 13:55:33','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Fonction','titre','publish','closed','closed','','field_5ba8ecc51ccad','','','2018-09-24 13:55:33','2018-09-24 13:55:33','',293,'http://dev.c-e-a.asso.fr/?post_type=acf-field&p=321',1,'acf-field','',0),(322,1,'2018-09-25 06:40:57','2018-09-25 06:40:57','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2018-09-25 06:40:57','2018-09-25 06:40:57','',1,'http://dev.c-e-a.asso.fr/1-revision-v1/',0,'revision','',0),(323,1,'2018-09-25 06:58:43','2018-09-25 06:58:43','<strong>Application deadline – Wednesday 8 August 2018</strong>\r\n\r\nEstablished in 2009, Nottingham Contemporary’s Public Programme is a pioneering three-way partnership between Nottingham Contemporary, Nottingham Trent University and the University of Nottingham.\r\n\r\nNottingham Contemporary’s Public Programme consists of more than 100 free-to-attend public events each year. These events include: screenings, performances, workshops, symposia, and publishing practices. The Programme explores each of Nottingham Contemporary’s Exhibition’s ideas, contemporary cultural and political debates, as well as long-term research strands about critical curatorial practices, visual cultures and postcolonial debates.\r\n\r\nThe Programme is committed to connecting the interests of our local community with current debates from across the globe, whilst also engaging with practice-based research, exploring new modes of inquiry in the cultural sector in collaboration with academics and cultural practitioners.\r\n\r\nWe are now looking for an experienced and enthusiastic Curator who will work closely with the Head of Public Programmes and Research to support the strategic development of our offer. The Curator of Public Programmes will develop and manage our series of events with the team of programmers.\r\n\r\nTo be successful in this role you will be a self-motivated, team player with experience of project management and event organisation in the cultural and academic sector. Additionally, you will have an interest in and an understanding of international contemporary art and socio-political debates, critical theory and cultural studies, and postcolonial concerns in a multi-disciplinary context.\r\n\r\n<strong><a href=\"http://www.nottinghamcontemporary.org/opportunities\">More information</a></strong>','Job opportunity – Curator of Public Programmes, Nottingham Contemporary, UK','','publish','open','open','','job-opportunity-curator-of-public-programmes-nottingham-contemporary-uk-2','','','2018-09-25 06:58:43','2018-09-25 06:58:43','',0,'http://dev.c-e-a.asso.fr/?p=323',0,'post','',0),(324,1,'2018-09-25 06:58:43','2018-09-25 06:58:43','<strong>Application deadline – Wednesday 8 August 2018</strong>\r\n\r\nEstablished in 2009, Nottingham Contemporary’s Public Programme is a pioneering three-way partnership between Nottingham Contemporary, Nottingham Trent University and the University of Nottingham.\r\n\r\nNottingham Contemporary’s Public Programme consists of more than 100 free-to-attend public events each year. These events include: screenings, performances, workshops, symposia, and publishing practices. The Programme explores each of Nottingham Contemporary’s Exhibition’s ideas, contemporary cultural and political debates, as well as long-term research strands about critical curatorial practices, visual cultures and postcolonial debates.\r\n\r\nThe Programme is committed to connecting the interests of our local community with current debates from across the globe, whilst also engaging with practice-based research, exploring new modes of inquiry in the cultural sector in collaboration with academics and cultural practitioners.\r\n\r\nWe are now looking for an experienced and enthusiastic Curator who will work closely with the Head of Public Programmes and Research to support the strategic development of our offer. The Curator of Public Programmes will develop and manage our series of events with the team of programmers.\r\n\r\nTo be successful in this role you will be a self-motivated, team player with experience of project management and event organisation in the cultural and academic sector. Additionally, you will have an interest in and an understanding of international contemporary art and socio-political debates, critical theory and cultural studies, and postcolonial concerns in a multi-disciplinary context.\r\n\r\n<strong><a href=\"http://www.nottinghamcontemporary.org/opportunities\">More information</a></strong>','Job opportunity – Curator of Public Programmes, Nottingham Contemporary, UK','','inherit','closed','closed','','323-revision-v1','','','2018-09-25 06:58:43','2018-09-25 06:58:43','',323,'http://dev.c-e-a.asso.fr/323-revision-v1/',0,'revision','',0),(325,1,'2018-09-25 07:45:27','2018-09-25 07:45:27','','échanger','','inherit','closed','closed','','23-revision-v1','','','2018-09-25 07:45:27','2018-09-25 07:45:27','',23,'http://dev.c-e-a.asso.fr/23-revision-v1/',0,'revision','',0),(326,1,'2018-09-25 07:50:38','2018-09-25 07:50:38','','Les Commissaires Developpeurs','','publish','closed','closed','','les-commissaires-developpeurs','','','2018-09-25 07:50:38','2018-09-25 07:50:38','',0,'http://dev.c-e-a.asso.fr/groupes/les-commissaires-developpeurs/',0,'groupes','',0),(327,1,'2018-09-25 08:10:47','2018-09-25 08:10:47','','7-810x716','','inherit','closed','closed','','7-810x716','','','2018-0